import create from './create';
import Collection from './Collection';
import * as types from './types';
import * as utils from './utils';
Collection.create = create;
export default create;

export { create, utils, types };
import { detectType } from './utils/tests';
import { optionsObj, FormEnum, TypeEnum } from './types';
import MapCollection from './MapCollection';
import ScalarCollection from './ScalarCollection';
import StringCollection from './StringCollection';
import ArrayCollection from './ArrayCollection';
import ObjectCollection from './ObjectCollection';
import SetCollection from './SetCollection';

export default (store, options?: optionsObj) => {
  let out;

  switch (detectType(store)) {
    case FormEnum.map:
      out = new MapCollection(store, options);
      break;

    case TypeEnum.string:
      out = new StringCollection(store, options);
      break;

    case FormEnum.array:
      out = new ArrayCollection(store, options);
      break;

    case FormEnum.object:
      out = new ObjectCollection(store, options);
      break;

    case FormEnum.set:
      out = new SetCollection(store, options);
      break;

    default:
      out = new ScalarCollection(store, options);
  }

  return out;
};
/* eslint-disable @typescript-eslint/ban-ts-comment */
import { DefEnum, FormEnum, TypeEnum } from '../types';
import { ABSENT } from '../types';

export function typeTest(type) {
  return value => typeof value === type;
}

export function isThere(item) {
  return ![ABSENT, undefined].includes(item);
}

// isEmpty is NOT a simple syntactic inverse of isThere; it includes null,
// which is not a qualifier of isThere.
export function isEmpty(item) {
  return [ABSENT, null, undefined].includes(item);
}

export const isNum = typeTest('number');

/**
 * a type check; if nonEmpty = true, only true if array has indexed values.
 * @param a
 * @param nonEmpty
 * @returns {boolean}
 */
export function isArr(a, nonEmpty = false) {
  return !!(Array.isArray(a) && (!nonEmpty || a.length));
}

export const isMap = m => m && m instanceof Map;

/**
 * returns true if the object is a POJO object -- that is,
 * its non-null, is an instance of Object, and is not an array.
 *
 * @param o
 * @param isAnyObj {boolean} whether arrays, maps should be included as objecg
 * @returns {boolean}
 */
export function isObj(o, isAnyObj = false) {
  return o && typeof o === 'object' && (isAnyObj || !(isArr(o) || isMap(o)));
}

export const isFn = typeTest('function');

export const isDate = d => d instanceof Date;

export const isSet = d => d instanceof Set;

export const isSymbol = typeTest('symbol');

export function isWhole(value) {
  if (!isNum(value)) {
    return false;
  }
  return value >= 0 && !(value % 2);
}

/**
 * returns a decorated error; an Error instance with extra annotations
 * @param err
 * @param notes
 */
export const e = (err, notes = {}) => {
  if (typeof err === 'string') {
    err = new Error(err);
  }
  if (!isThere(notes)) {
    notes = {};
  } else if (!isObj(notes)) {
    notes = { notes };
  }
  return Object.assign(err, notes);
};

export function isStr(s, nonEmpty = false) {
  if (typeof s === 'string') {
    return nonEmpty ? !!s : true;
  }
  return false;
}

export const isUndefined = typeTest('undefined');

export const TESTS = [
  { name: TypeEnum.undefined, test: isUndefined, isForm: false },
  { name: FormEnum.map, test: isMap, isForm: true },
  { name: TypeEnum.symbol, test: isSymbol, isForm: false },
  { name: FormEnum.array, test: isArr, isForm: true },
  { name: FormEnum.function, test: isFn, isForm: true },
  { name: TypeEnum.date, test: isDate, isForm: false },
  { name: FormEnum.set, test: isSet, isForm: true },
  { name: FormEnum.object, test: isObj, isForm: true },
  { name: TypeEnum.string, test: isStr, isForm: false },
  { name: TypeEnum.number, test: isNum, isForm: false },
  { name: FormEnum.scalar, test: () => true, isForm: true },
];

/**
 * detectForm is only concerned with containment patterns.
 * @param value
 */
export function detectForm(value: any): FormEnum {
  for (let i = 0; i < TESTS.length; ++i) {
    const def = TESTS[i];
    if (!def.isForm) {
      continue;
    }
    if (def.test(value)) {
      return def.name as FormEnum;
    }
  }

  return FormEnum.scalar;
}

export function formIsCompound(form: FormEnum) {
  return [
    FormEnum.map,
    FormEnum.map,
    FormEnum.array,
    FormEnum.object,
    FormEnum.set,
  ].includes(form);
}

export function detectType(value: any) {
  for (let i = 0; i < TESTS.length; ++i) {
    const def = TESTS[i];
    if (def.isForm) {
      continue;
    }
    try {
      if (def.test(value)) {
        return def.name;
      }
    } catch (err) {
      console.log('error in def', def, err);
    }
  }

  return detectForm(value) as DefEnum;
}

// const FIND_SYMBOL = /Symbol\((.*:)?(.*)\)/;

export function returnOrError(fn, ...args) {
  if (typeof fn !== 'function') {
    throw new Error('returnOrError MUST be passed a function');
  }
  try {
    return fn(...args);
  } catch (err) {
    return err;
  }
}

/**
 * allow custom form/type definitions by application developer;
 * @param name
 * @param test
 * @param isForm
 * @param order
 export function addTest(name, test, isForm = false, order = 0) {
  TESTS.push(name, {name: name, test, isForm, order));
}
 */
import {
  comparatorFn,
  filterAction,
  typesMethods,
  orderingFn,
  reduceAction,
} from './types.methods';

export enum TypeEnum {
  string = 'string',
  number = 'number',
  date = 'date',
  null = 'null',
  symbol = 'symbol',
  any = 'any',
  undefined = 'undefined',
}

export enum FormEnum {
  array = 'Array',
  map = 'Map',
  object = 'object',
  set = 'set',
  scalar = 'scalar',
  function = 'function',
  any = 'any',
}

export type DefEnum = TypeEnum | FormEnum;

export const ABSENT = Symbol('ABSENT');

export type keyType = any;

export type someValues = Array<any>;
export type valueType = any;
export type oneOrMoreValues = valueType | someValues;

export enum booleanMode {
  byValue = 'value',
  byKey = 'key',
  byBoth = 'both',
}

export type comparatorObj = {
  compKeys?: comparatorFn;
  compItems?: comparatorFn;
};

export type collectionBaseObj<StoreType, KeyType, ItemType> = {
  readonly store: StoreType;
  keys: KeyType[];
  items: ItemType[];

  // reflection
  form: FormEnum;
  type: DefEnum;
  size: number;
  clone: (optionsObj?) => collectionObj<StoreType, KeyType, ItemType>; // new collection with cloned item
};

export type collectionIterProvider<_StoreType, KeyType, ItemType> = {
  storeIter: (fromIter?: boolean) => IterableIterator<[KeyType, ItemType]>;
  itemIter: (fromIter?: boolean) => IterableIterator<ItemType>;
  keyIter: (fromIter?: boolean) => IterableIterator<KeyType>;
};

export type optionsObj = { quiet?: boolean } & comparatorObj;
export type collectionBaseIterProvider<
  StoreType,
  KeyType,
  ItemType
> = collectionIterProvider<StoreType, KeyType, ItemType> &
  collectionBaseObj<StoreType, KeyType, ItemType> &
  optionsObj;

export type changeObserver = (
  pendingStore: any,
  action: string,
  opts?: any
) => any;

export type collectionObj<StoreType, KeyType, ItemType> = {
  // Reflection
  hasItem: (item: ItemType) => boolean;
  hasKey: (key: KeyType) => boolean;
  keyOf: (item: ItemType) => KeyType | undefined; // the _first_ key of a given item
  // an item may be associated with more than one key -- this is the first one.
  get: (key: KeyType) => any;
  // comparison
  withComp: (action: () => any, config: optionsObj) => any; // performs operations with the given comparators operating, then returns current ones.

  // changes
  change(newValue): collectionObj<StoreType, KeyType, ItemType>; // self
  set: (
    key: KeyType,
    value: any
  ) => collectionObj<StoreType, KeyType, ItemType>; // self
  deleteKey: (
    key: KeyType | Array<KeyType>
  ) => collectionObj<StoreType, KeyType, ItemType>; // self
  deleteItem: (
    item: ItemType | Array<ItemType>
  ) => collectionObj<ItemType, KeyType, ItemType>; // self
  clear: () => collectionObj<StoreType, KeyType, ItemType>; // self
  sort: (sorter?: orderingFn) => collectionObj<StoreType, KeyType, ItemType>; // self
  c: collectionObj<StoreType, KeyType, ItemType>; // a property identical to clone; for convenience.brevity

  // iteration
  forEach: (
    action: typesMethods
  ) => collectionObj<StoreType, KeyType, ItemType>; // self
  map: (action: typesMethods) => collectionObj<StoreType, KeyType, ItemType>; // mutates properties
  filter: (action: filterAction) => collectionObj<StoreType, KeyType, ItemType>; // a new collection wth some of the values;
  reduce: (action: reduceAction, initial: any) => any; // an arbitrary value, computed by looping over the store
  reduceC: (action: reduceAction, initial: any) => collectionObj<any, any, any>; // a new collection for the output of reduce
  // note : the new collection may not be the same type as the start collection

  // observation
  onChange?: changeObserver;
} & collectionBaseIterProvider<StoreType, KeyType, ItemType>;

/*
type _unusedBooleanOperator<ItemType, ValueType> = {
  union: (
    other: ValueType | collectionObj<any, any, any>,
    mode?: booleanMode
  ) => collectionObj<ValueType, KeyType, ItemType>;
  difference: (
    value: ValueType | collectionObj<any, any, any>,
    mode?: booleanMode
  ) => collectionObj<ValueType, KeyType, ItemType>;
  intersection: (
    other: ValueType | collectionObj<any, any, any>,
    mode?: booleanMode
  ) => collectionObj<ValueType, KeyType, ItemType>;
}*/
import CompoundCollection from './CompoundCollection';
import { collectionObj, optionsObj } from './types';
import { Match } from './utils/Match';
import { orderingFn } from './types.methods';
import { clone } from './utils/change';
import compare from './utils/compare';

export default class MapCollection extends CompoundCollection
  implements collectionObj<Map<any, any>, any, any> {
  protected _store: Map<any, any>;

  constructor(store: Map<any, any>, options?: optionsObj) {
    super(store, options);
    this.update(store, 'constructor', options);
    this._store = store;
  }

  get(key) {
    if (this._store.has(key)) {
      return this._store.get(key);
    }
    return super.get(key);
  }

  get keys() {
    return Array.from(this.store.keys());
  }

  get items() {
    return Array.from(this.store.values());
  }

  clone(newOptions?: optionsObj) {
    return new MapCollection(clone(this._store), this.mergeOptions(newOptions));
  }

  keyOf(item: any): any {
    const key = undefined;

    return this.reduce((foundKey, mItem, mKey, _store, iter) => {
      if (Match.sameItem(mItem, item, this)) {
        iter.final();
        return mKey;
      }
      return foundKey;
    }, key);
  }

  sort(sorter: orderingFn = compare): collectionObj<Map<any, any>, any, any> {
    const map = new Map();
    const sortedKeys = Array.from(this.keys).sort(this.sorter(sorter));
    for (let i = 0; i < sortedKeys.length; i++) {
      const key = sortedKeys[i];
      map.set(key, this.store.get(key));
    }
    this.update(map, 'sort', sorter);
    return this;
  }

  hasItem(item) {
    return this.reduce((matches, mItem, _key, _store, iter) => {
      if (Match.sameItem(mItem, item, this)) {
        iter.final();
        return true;
      }
      return matches;
    }, false);
  }

  deleteKey(key) {
    const map = new Map(this.store);
    for (const storeKey of this.keys) {
      if (Match.sameKey(storeKey, key, this)) {
        map.delete(storeKey);
      }
    }
    this.update(map, 'delete', key);
    return this;
  }

  // iterators

  keyIter(): IterableIterator<any> {
    return this._store.keys();
  }

  itemIter(): IterableIterator<any> {
    return this._store.values();
  }

  storeIter(): IterableIterator<any> {
    return this._store.entries();
  }
}
import Collection from './Collection';
import { Stopper } from './utils/Stopper';
import { Match } from './utils/Match';
import { filterAction, typesMethods, reduceAction } from './types.methods';
import { collectionObj, optionsObj } from './types';

/**
 * This is a baseline
 */
export default abstract class CompoundCollection extends Collection {
  get size() {
    return this.store.size;
  }

  get keys(): any[] {
    return this.store.keys();
  }

  get items(): any[] {
    return this.store.values();
  }

  hasItem(item: any) {
    return Array.from(this.items).some(storeItem =>
      Match.sameItem(storeItem, item, this)
    );
  }

  hasKey(key: any) {
    if (this.store.has(key)) {
      return true;
    }
    const iter = this.keyIter();

    for (const storeKey of iter) {
      if (Match.sameKey(storeKey, key, this)) {
        return true;
      }
    }

    return false;
  }

  set(key, item) {
    for (const storeKey of this.keys) {
      if (Match.sameKey(storeKey, key, this)) {
        this.store.set(storeKey, item);
        return this;
      }
    }
    this.store.set(key, item);
    return this;
  }

  get(key) {
    return this.reduce((found, item, itemKey, _store, stopper) => {
      if (Match.sameKey(itemKey, key, this)) {
        stopper.final();
        return item;
      }
      return found;
    }, undefined);
  }

  keyOf(item): any | undefined {
    const index = this.items.indexOf(item);
    if (index === -1) {
      return undefined;
    }
    return index;
  }

  deleteKey(key) {
    this.store.deleteKey(key);
    return this;
  }

  deleteItem(item: any | any[]) {
    return this.filter(oItem => !Match.sameItem(oItem, item, this));
  }

  clear() {
    this.store.clear();
    return this;
  }

  filter(test: filterAction) {
    const tempC = this.clone({ quiet: true }).clear();

    const stopper = new Stopper();

    const iter = this.storeIter();

    for (const [key, item] of iter) {
      const use = test(item, key, this.store, stopper);
      if (stopper.isStopped) {
        break;
      }
      if (use) {
        tempC.set(key, item);
      }
      if (stopper.isLast) {
        break;
      }
    }

    this.update(tempC.store, 'filter', test);
    return this;
  }

  forEach(loop: typesMethods) {
    const stopper = new Stopper();
    const iter = this.storeIter();

    for (const [key, item] of iter) {
      loop(item, key, this.store, stopper);
      if (stopper.isComplete) {
        break;
      }
    }

    return this;
  }

  abstract clone(opts?: optionsObj): collectionObj<any, any, any>;

  map(loop: typesMethods) {
    const stopper = new Stopper();
    const iter = this.storeIter();

    const nextMapCollection = this.clone({ quiet: true }).clear();

    for (const [key, keyItem] of iter) {
      const newItem = loop(keyItem, key, this.store, stopper);
      if (stopper.isComplete) {
        break;
      }
      nextMapCollection.set(key, newItem);
      if (stopper.isComplete) {
        break;
      }
    }
    this.update(nextMapCollection.store, 'map', loop);

    return this;
  }

  reduce(looper: reduceAction, initial?: any) {
    const stopper = new Stopper();

    let out = initial;
    const iter = this.storeIter();

    for (const [key, item] of iter) {
      const next = looper(out, item, key, this.store, stopper);
      if (stopper.isStopped) {
        return out;
      }
      out = next;
      if (stopper.isComplete) {
        return next;
      }
    }

    return out;
  }

  reduceC(action, start) {
    const value = this.reduce(action, start);
    return Collection.create(value);
  }

  // iterators

  abstract keyIter(fromIter?: boolean): IterableIterator<any>;

  abstract itemIter(fromIter?: boolean): IterableIterator<any>;

  abstract storeIter(fromIter?: boolean): IterableIterator<any>;
}
/* eslint-disable @typescript-eslint/no-unused-vars */
import { DefEnum, FormEnum, optionsObj } from './types';
import { detectForm, detectType, e, isFn } from './utils/tests';
import { clone } from './utils/change';
import { StandinCollection } from './utils/StandinCollection';
import { comparatorFn, onChangeFn, orderingFn } from './types.methods';

const simpleComparator = (a, b) => a === b;

// note - Collection is NOT compatible with the full collectionObj signature
export default abstract class Collection {
  constructor(_store, options) {
    // note - does NOT set store, as that should be done at the implementor level, for type reasons
    if (options?.compKeys) {
      this.compKeys = options?.compKeys || simpleComparator;
    }
    if (options?.compItems) {
      this.compItems = options?.compItems || simpleComparator;
    }
    this.quiet = !!options?.quiet;
  }

  public onChange?: onChangeFn;

  change(newStore) {
    if (typeof newStore === 'function') {
      try {
        const cloned = clone(this.store);
        let updated = newStore(cloned);
        if (updated === undefined) updated = cloned;

        if (updated === newStore) {
          throw e('circular change', { newStore, target: this });
        }

        return this.change(updated);
      } catch (err) {
        throw e('functional newStore throws error:', {
          err,
          newStore,
          target: this,
        });
      }
    }
    const newType = detectType(newStore);
    if (newType !== this.type) {
      throw e('attempt to setStore different type than exists now', {
        target: this,
        newStore,
        type: newType,
      });
    }
    return this.update(newStore, 'change');
  }
  protected update(newStore, source?: string, ...input) {
    try {
      if (!this.quiet && this.onChange && source) {
        this.onChange(newStore, source, input);
      }
    } catch (err) {
      console.warn('update: onChange error', err);
      return this;
    }
    this._store = newStore;
    return this;
  }

  protected sorter(sortFn?: orderingFn) {
    return sortFn ? (a, b) => sortFn(a, b, this) : undefined;
  }

  get store(): any {
    return this._store;
  }
  protected _store: any;

  abstract get size(): number;

  abstract get keys(): number[];
  abstract get items(): any[];

  // options and comparator

  mergeOptions(mergeOptions?: optionsObj) {
    const newOptions = { ...this.options };
    if (!mergeOptions) return newOptions;
    for (const newKey of Object.keys(mergeOptions)) {
      newOptions[newKey] = mergeOptions[newKey];
    }
    return newOptions;
  }

  get options() {
    return {
      quiet: this.quiet,
      compKeys: this.compKeys,
      compItems: this.compItems,
    };
  }
  public quiet = false;

  protected _compKeys: comparatorFn = simpleComparator;

  get compKeys(): comparatorFn {
    return this._compKeys || simpleComparator;
  }

  set compKeys(value: comparatorFn) {
    if (!isFn(value)) {
      throw e('improper compKeys function', { target: this, fn: value });
    }
    this._compKeys = value;
  }

  protected _compItems: comparatorFn = simpleComparator;

  get compItems(): comparatorFn {
    return this._compItems || simpleComparator;
  }

  set compItems(value: comparatorFn) {
    if (!isFn(value)) {
      throw e('improper compItems function', { target: this, fn: value });
    }
    this._compItems = value;
  }

  get form(): FormEnum {
    return detectForm(this._store);
  }

  get type(): DefEnum {
    return detectType(this._store);
  }

  get c() {
    return Collection.create(clone(this._store));
  }

  withComp(action, comp: optionsObj) {
    let out = null;

    const { compKeys, compItems } = this;
    try {
      if (comp.compKeys) this.compKeys = comp.compKeys;
      if (comp.compItems) this.compItems = comp.compItems;
      out = action();
    } catch (err) {
      this.compKeys = compKeys;
      this.compItems = compItems;
      throw err;
    }

    return out;
  }

  // must be overridden before any collections are created with a working create method
  static create = (store, options?: optionsObj) => {
    return new StandinCollection(store, options);
  };
}
import { ABSENT, DefEnum, FormEnum, TypeEnum } from '../types';
import { detectForm, detectType, isThere } from './tests';
import cloneDeep from 'lodash.clonedeep';

export const clone = cloneDeep;

export function makeEmpty(likeThis, type?: DefEnum) {
  if (!isThere(type)) {
    type = detectType(likeThis);
  }
  let out = likeThis;
  switch (type) {
    case TypeEnum.number:
      out = 0;
      break;

    case TypeEnum.string:
      out = '';
      break;

    case FormEnum.map:
      out = new Map();
      break;

    case FormEnum.object:
      out = {};
      break;

    case FormEnum.array:
      out = [];
      break;

    case TypeEnum.date:
      out = new Date();
      break;

    case FormEnum.set:
      out = new Set();
      break;

    case TypeEnum.symbol:
      out = Symbol();
      break;
  }
  return out;
}

/**
 * merge similar form
 * @param value
 * @param change
 * @param form
 */
export function amend(value, change, form: string | symbol = ABSENT) {
  if (!isThere(form)) {
    form = detectForm(value);
  }
  let out = value;
  switch (form) {
    case FormEnum.map:
      out = new Map(value);
      change.forEach((keyValue, key) => {
        out.set(key, keyValue);
      });
      break;

    case FormEnum.object:
      out = { ...value };
      Object.keys(change).forEach(key => {
        out[key] = change[key];
      });
      break;

    case FormEnum.array:
      out = [...value];
      change.forEach((item, index) => {
        out[index] = item;
      });
      break;
  }
  return out;
}
import { collectionObj, optionsObj, DefEnum, FormEnum } from '../types';
import { clone } from './change';
import {
  filterAction,
  typesMethods,
  orderingFn,
  reduceAction,
} from '../types.methods';

export class StandinCollection implements collectionObj<any, any, any> {
  compItems = (a, b) => a === b;
  compKeys = (a, b) => a === b;
  withComp(fn, {}) {
    return fn();
  }
  public quiet = false;
  constructor(store, options?: optionsObj) {
    this.store = store;
    if (options?.compKeys) {
      this.compKeys = options?.compKeys;
    }
    if (options?.compItems) {
      this.compItems = options?.compItems;
    }
    this.quiet = !!options?.quiet;
  }

  clear(): collectionObj<any, any, any> {
    return this;
  }

  clone(newOptions?: optionsObj): collectionObj<any, any, any> {
    return new StandinCollection(clone(this.store), newOptions);
  }

  get c() {
    return this.clone();
  }

  deleteKey(_key: any): collectionObj<any, any, any> {
    return this;
  }

  deleteItem(_key: any): collectionObj<any, any, any> {
    return this;
  }

  filter(_action: filterAction): collectionObj<any, any, any> {
    return this;
  }

  forEach(_action: typesMethods): collectionObj<any, any, any> {
    return this;
  }

  form: FormEnum = FormEnum.object;

  get(_key: any): any {
    return null;
  }

  hasItem(_item: any): boolean {
    return false;
  }

  hasKey(_key: any): boolean {
    return false;
  }

  items: any[] = [];

  keyOf(_item: any): any {
    return undefined;
  }

  keys: any[] = [];

  map(_action: typesMethods): collectionObj<any, any, any> {
    return this;
  }

  reduce(_action: reduceAction, _initial: any): any {
    return null;
  }

  reduceC(_action: reduceAction, _initial: any): collectionObj<any, any, any> {
    return this;
  }

  set(_key: any, _value: any): collectionObj<any, any, any> {
    return this;
  }

  size = 0;

  sort(_sorter: orderingFn | undefined): collectionObj<any, any, any> {
    return this;
  }

  change(newStore) {
    this.store = newStore;
    return this;
  }
  store: any;
  type: DefEnum = FormEnum.object;

  // iterators

  keyIter(): IterableIterator<any> {
    return this.keys[Symbol.iterator]();
  }

  itemIter(): IterableIterator<any> {
    return this.items[Symbol.iterator]();
  }

  storeIter() {
