  get isStopped() {
    return this.state === stopperEnum.stop;
  }

  get isComplete() {
    return this.state !== stopperEnum.continue;
  }

  get isLast() {
    return this.state === stopperEnum.last;
  }

  // change methods

  final() {
    this.state = stopperEnum.last;
  }

  stop() {
