import { optionsObj } from '../types';

export abstract class Match {
  static sameKey(
    key: any,
    k2: any,
    context: optionsObj,
    many = true, // individually compare keys if arrays
    debug = false
  ) {
    if (!context?.compKeys) {
      if (debug) {
        console.log('Match: no comparator for keys; returning === comparison');
      }
      return key === k2;
    }
    if (many && Array.isArray(k2)) {
      if (debug) {
        console.log(
          'comparing individual keys:',
          k2,
          'to',
          key,
          'context.compKeys = ',
          context?.compKeys
        );
      }
      return k2.some(otherSubKey => {
        const use = context?.compKeys
          ? context.compKeys(key, otherSubKey)
          : key === otherSubKey;
        if (debug) {
          console.log(
            'MATCH subkey comparison: ',
            otherSubKey,
            'to first key',
            key,
            'result: ',
            use
          );
        }
        return use;
      });
    }
    return context.compKeys(key, k2);
  }

  static sameItem(item: any, i2: any, context: optionsObj, many = true) {
    if (!context?.compItems) {
      return item === i2;
    }
    if (many && Array.isArray(i2)) {
      return i2.some(otherSubItem => {
        return context?.compItems
          ? context.compItems(item, otherSubItem)
          : item === otherSubItem;
      });
    }
    return context.compItems(item, i2);
  }
}
import { detectType, formIsCompound, isEmpty } from './tests';
import { DefEnum, FormEnum, TypeEnum } from '../types';
import toString from 'lodash.tostring';

const simpleTypeOrder: DefEnum[] = [
  TypeEnum.undefined,
  TypeEnum.null,
  TypeEnum.number,
  TypeEnum.string,
];
function compareTypes(a, b, typeA?: DefEnum, typeB?: DefEnum) {
  if (!typeA) typeA = detectType(a);
  if (!typeB) typeB = detectType(b);

  if (typeA === TypeEnum.date) {
    if (typeB === TypeEnum.date) {
      return compareTypes(
        (a as Date).getTime(),
        (b as Date).getTime(),
        TypeEnum.number,
        TypeEnum.number
      );
    }
    return compareTypes((a as Date).getTime(), b, TypeEnum.number, typeB);
  } else if (typeB === TypeEnum.date) {
    return compareTypes(a, (b as Date).getTime(), typeA, TypeEnum.number);
  }

  // order some types by type
  if (typeA !== typeB) {
    if (simpleTypeOrder.includes(typeA) && simpleTypeOrder.includes(typeB)) {
      const diff =
        simpleTypeOrder.indexOf(typeA) - simpleTypeOrder.indexOf(typeB);
      return diff / Math.abs(diff);
    }
  }

  // compare numbers by value.
  if (typeA === TypeEnum.number && typeB === TypeEnum.number) {
    return (a - b) / Math.abs(a - b);
  }

  // compare strings by value;
  // sort strings before non-strings
  if (typeA === TypeEnum.string) {
    if (typeB === TypeEnum.string) {
      if (a > b) return 1;
      return -1;
    }
    return -1;
  } else if (typeB === TypeEnum.string) {
    return 1;
  }

  if (formIsCompound(typeA as FormEnum)) {
    if (formIsCompound(typeB as FormEnum)) {
      return compareTypes(
        toString(a),
        toString(b),
        TypeEnum.string,
        TypeEnum.string
      );
    }
    return 1;
  } else if (formIsCompound(typeB as FormEnum)) {
    return compareTypes(a, toString(b), typeA, TypeEnum.string);
  }

  if (a > b) return 1;
  return -1;
}

/**
 * the rule or the sort function is :
 * if the values are equal, return 0;
 * if (b > a) return 1; -- sort is b, a
 * if (a > b) return -1; -- sort is a, b
 * @param a
 * @param b
 */
export default function compare(a, b) {
  if (a === b) return 0;

  if (isEmpty(a)) {
    if (isEmpty(b)) {
      return 0;
      return -1;
    }
  } else if (isEmpty(b)) {
    return 1;
  }

  return compareTypes(a, b);
}
