export default class ScalarCollection extends Collection {
  protected _store: any;
  constructor(store: any, options?: optionsObj) {
    super(store, options);
    this._store = store;
  }

  get size() {
    return 0;
  }

  get(_key) {
    this.err('key');
    return 0;
  }

  set(_key, _item) {
    this.err('set');
    return this;
  }

  hasKey(_item) {
    this.err('hasKey');
    return null;
  }

  hasItem(_item) {
    this.err('hasItem');
    return null;
  }

  keyOf(_item) {
    this.err('keyOf');
    return undefined;
  }

  err(method) {
