  }

  get keys() {
    this.err('keys');
    return [];
  }

  get items() {
    this.err('items');
    return [];
  }

  deleteKey() {
    this.err('delete');
  }

  clear() {
    this.update(undefined, 'clear');
  }

  forEach() {
    this.err('forEach');
  }

  map() {
    this.err('map');
    return [];
  }

  reduce() {
    this.err('reduce');
    return null;
  }
}
