    return this.intersection(other.items);
  }

  // endregion

  storeIter() {
    return this.items.entries();
  }

  keyIter() {
    return this.keys[Symbol.iterator]();
  }

  itemIter() {
    return this.items[Symbol.iterator]();
  }
